from django.core.management.base import BaseCommand
import base64
import os

image_string = ""

class Command(BaseCommand):
    help = "Decodes base64 image strings"

    def handle(self, *args, **options):
        # Example Base64 string (replace this with your actual string)
        base64_string = image_string # Truncated example

        # Decode the Base64 string
        image_data = base64.b64decode(base64_string)

        # Get the Pictures folder path
        pictures_folder = os.path.join(os.path.expanduser("~"), "Documents")
        output_path = os.path.join(pictures_folder, "decoded_image.png")

        # Save the decoded image
        with open(output_path, "wb") as f:
            f.write(image_data)

        print(f"Image saved to: {output_path}")